import React, { Component } from 'react';
import '../App.css';
import TodosList from "./TodosList"
import DoneList from "./DoneList"



class App extends Component {

  componentWillMount() {
    let data = [];
    todoListData.on('value', (snapshot) => {
      snapshot.forEach(item => {
        let Id = item.key;
        let Name = item.val().Name;
        let Level = item.val().Level;
        let Status = item.val().Status;
        data.push({
          Id: Id,
          Name: Name,
          Level: Level,
          Status: Status
        });
        this.setState({
          data: data
        })
      })
    })
  }

  render() {
    return (
      <div className="App">
        <div className="container">
          <div className="row">
            <TodosList></TodosList>
            <DoneList></DoneList>
          </div>
        </div>

      </div>
    );
  }
}


export default App;
